import { BrowserRouter } from "react-router-dom"
import logo from '../media/hellbentLogo.png'

const BannerImage = () => {
    return(
        <Route to="/tasks">
            <img
              className="ui centered medium image"
              style={{ maxWidth: '200px' }}
              alt="logo"
              src={logo}
            ></img>
          </Route>
    )
}

